import { useEffect, useState } from 'react';

export default function Mentors() {

    const [mentorList, setMentorList] = useState(null)

    useEffect(() => {
        fetchMentors();
    }, [])

    function fetchMentors() {
        fetch('http://localhost:5000/mentors')
            .then( (response) => response.json() )
            .then( (data) => {
                setMentorList(data);
                console.log(data)
            })
            .catch( err => console.log(err) );
    }

    if (!mentorList) return <h1>Loading mentors...</h1>

    return (
        <div className='Mentors'>
            {/* <img src='' alt='' / className='mentor-pfp> */}
            <h3>Mentor Name: {mentorList[0].fullname}</h3>
            <ol>
                <li>Profession:</li>
                <li>Description:</li>
                <li>Email address:</li>
                <ul>
                    <li>Interest1:</li>
                    <li>Interest2:</li>
                    <li>Interest3:</li>
                </ul>
            </ol>
        </div>
    );
}
